import { Router } from "express"
import path from "path";
import { serverDirName } from "../server.js"

const router = Router();

let imagesList = []

function createImage(src, title, description, date) {
    imagesList.push({
        src,
        title,
        description,
        date,
        windowHtml : null,
        loadState : false,
        id: imagesList.length + 1
        }
    )
}

createImage("src/img1.jpg", "We love new traditions at BINcA!", "This year our seniors decided to meet the sunrise. Check them out at Carson Beach. What a way to build unity at the beginning of the school year.", "October 9, 2023")

createImage("src/img2.jpg", "Congratulations to all our graduates!", "The Salutatorian, @xuaanmeii and the Valedictorian, @chenaya_v12 and the Student government president, @___eud___ all gave lively speeches full of wit and wisdom. Extra praise to our PESO award winners: Elfido, @olyivi3 , @abdes_salam1 and Zakariya! A beautiful day for the whole BINcA family!", "June 10, 2023")

createImage("src/img3.jpg", "Favorite prom horizontals!", "A night to remember!", "October 9, 2023")

createImage("src/img4.jpg", "What a wonderful night of 1000 stories!", "We are  proud of our current students JL and Chenaya whose creativity was on display - with a boost from @whitesnakeprojects - and superstar alumnus @dr.chiruza_ who gave a moving speech about the importance of Writers Rooms for both expression and mental health.  Bonus: getting to hear a keynote from @jamiehector and his daughter Chloe.", "May 18, 2023")

createImage("src/img5.jpg", "We just got back from a great trip to Washington DC!", "With students from the National Honor Society and the Black Student Union. 20K steps a day and we loved every minute! Special thanks to organizer @la_real_nairobi for creating such a special experience!", "April 17, 2023")

createImage("src/img6.jpg", "Favorite prom verticals beautiful!", "", "June 8, 2023")

router.get("/home", (req, res) => {
    res.sendFile(path.join(serverDirName, "public", "home", "binca.html"))
})

/////////////////FIX THIS THING HERE :)
router.get("/home/:loadedImages", (req, res) => {
    try{
        const imagesListChunk = imagesList.filter((img) => img.id > parseInt(req.params.loadedImages) && img.id <= parseInt(req.params.loadedImages)+6);
        res.json(imagesListChunk);
    } catch (err) {
        res.send(err)
    }
});

router.get("/about-us", (req, res) => {
    res.sendFile(path.join(serverDirName, "public", "about-us", "about-us.html"));
});

router.get("/for-families", (req, res) => {
    res.sendFile(path.join(serverDirName, "public", "for-families", "for-families.html"));
});

router.get("/for-students", (req, res) => {
    res.sendFile(path.join(serverDirName, "public", "for-students", "for-students.html"));
});

export default router;
